import React from "react"

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>&nbsp;</th>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    <tr key="1">
                        {
                            Object.keys(props.details).forEach(priKey => {
                                if (Number.isInteger(priKey)) {
                                    // Pass
                                }
                                else {
                                    if (typeof props.details[priKey] === 'object') {
                                        Object.keys(props.details[priKey]).forEach(secKey => {
                                            if (Number.isInteger(secKey)) {
                                                // Pass
                                            }
                                            else {
                                                console.log(`key: ${secKey}, value: ${props.details[priKey][secKey]}`)
                                            }
                                        }
                                        )
                                    }
                                    else {
                                        console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                                    }
                                }
                                // <td></td>
                                // console.log(`key: ${key}, value: ${props.details[key]}`)
                            }
                                // if (typeof props.details[key] === 'object') {
                                //     Object.keys(props.details[key]).forEach(key => {
                                //         console.log(`key: ${key}, value: ${props.details[key]}`)
                                //     })
                                // }
                                // else {
                                //     console.log(`key: ${key}, value: ${props.details[key]}`)
                                // }
                            )
                        }
                        {/* {
                            Object.keys([props.details]).map((detail, id) => <span key={id}>{props.details[detail]}</span>)
                        } */}
                        {/* <td>{props.details['alice']['id']}</td>
                            <td>{props.details['alice']['cash']}</td>
                            <td>{props.details['alice']['waitForInput']}</td> */}
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default ManageDetailsView;
